import React from "react";
import { useHistory } from "react-router-dom";

const Error = () =>{
    const History = useHistory();
    const Func1 = () =>{
        History.goBack();
    }
    return(
        <>
        <h1>Opps! Error In loading Page</h1>
        <p>Seems That This Page Is Not Available</p>
        <button onClick={Func1}>GO BACK</button>
        </>
    )
}
